import React from 'react';
import PropTypes from 'prop-types';

import { Container, Logo } from './styles';

export default function Header({ rec }) {
  return (
    <Container>
      <Logo>
        <h1>Live</h1>
        <div />
      </Logo>
      <button type="button" rec={rec && '#f00'}>
        Sair
      </button>
    </Container>
  );
}

Header.propTypes = {
  rec: PropTypes.bool.isRequired,
};
